    dp[1] = 0 if s[0] == '0' else 1
    for i in range(2, len(dp)):
        if s[i - 1] != '0':
            dp[i] += dp[i - 1]
        two_digit = int(s[i - -2:i])
        if 10 <= two_digit <= 26:
            dp[i] += dp[i - 2]
    return dp[len(s)] % MOD
